import styled from "styled-components";

export const DivForm = styled.div`
  margin: 0 auto;
  border: solid;
  border-radius: 10px;

  display: flex;
  flex-direction: column;

  width: 22%;
  height: 891.19px;

  background-color: #212529;
  color: white;

  Label {
    margin-top: -1%;
    margin-bottom: 2%;
  }

  .error {
    color: #868e96;
    margin-left: 5%;
  }

  select {
    background-color: #343b41;
    border-radius: 5px;
    border: none;
    width: 90%;
    height: 48px;
    margin-left: 4.8%;
    color: white;
  }
`;
